n    // @ApiOperation({ summary:  })\n    @Post(':url/chats/:id/contents')\n    async createChats(\n        @Param('url') url,\n        @Param('id') id:number, // ParseIntPipe \n        @Body('content') content,\n        @Users() user:User,\n    ){\n        return this.chatsService.createChats(url,content,id,12)\n    }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/ChatsModule.html":{"url":"modules/ChatsModule.html","title":"module - ChatsModule","body":"\n                   \n\n\n\n\n    Modules\n    ChatsModule\n\n\n\n    \n        \n\n\n\n\n\ndependencies\n\ndependencies\n\ncluster_ChatsModule\n\n\n\ncluster_ChatsModule_providers\n\n\n\n\nChatsService\n\nChatsService\n\n\n\nChatsModule\n\nChatsModule\n\nChatsModule -->\n\nChatsService->ChatsModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/chats/chats.module.ts\n        \n\n\n\n\n\n        \n            \n                \n                    Providers\n                    \n                        \n                            ChatsService\n                        \n                    \n                \n                \n                    Controllers\n                    \n                        \n                            ChatsController\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        import { Module } from '@nestjs/common';\nimport { ChatsService } from './chats.service';\nimport { ChatsController } from './chats.controller';\nimport { TypeOrmModule } from '@nestjs/typeorm';\nimport { User } from 'src/users/users.entity';\nimport { Chats } from 'src/chats/chats.entity';\n@Module({\n  imports: [TypeOrmModule.forFeature